import React from 'react';
import { motion } from 'framer-motion';

const About = () => {
  const features = [
    {
      title: "Profesionales Certificados",
      description: "Nuestro equipo cuenta con especialistas certificados en neuropsicología con amplia experiencia clínica."
    },
    {
      title: "Métodos Basados en Evidencia Científica", 
      description: "Utilizamos técnicas y protocolos respaldados por la investigación científica más actualizada."
    },
    {
      title: "Atención Personalizada",
      description: "Cada tratamiento es diseñado específicamente para las necesidades individuales de cada paciente."
    },
    {
      title: "Seguimiento Presencial y En Línea",
      description: "Ofrecemos flexibilidad en el seguimiento con opciones presenciales y telemedicina."
    }
  ];

  const images = [
    {
      src: "/api/placeholder/280/200",
      alt: "Consulta profesional",
      className: "rounded-3xl shadow-xl",
      size: "large",
      position: "top-left"
    },
    {
      src: "/api/placeholder/200/160", 
      alt: "Terapia grupal",
      className: "rounded-2xl shadow-lg",
      size: "small",
      position: "top-right"
    },
    {
      src: "/api/placeholder/220/180",
      alt: "Evaluación neuropsicológica",
      className: "rounded-2xl shadow-lg",
      size: "medium",
      position: "bottom-left"
    },
    {
      src: "/api/placeholder/260/220",
      alt: "Sesión de rehabilitación",
      className: "rounded-3xl shadow-xl",
      size: "large",
      position: "bottom-right"
    }
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2
      }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0, x: -20 },
    visible: {
      opacity: 1,
      x: 0,
      transition: {
        duration: 0.6
      }
    }
  };

  return (
    <section id="nosotros" className="py-20 bg-white">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <motion.div
          className="text-center mb-16"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
        >
          <h2 className="text-3xl font-bold text-neurops-black sm:text-4xl lg:text-5xl">
            ¿Por qué elegir <span className="text-neurops-black">Neurops</span>?
          </h2>
          <p className="mt-4 max-w-2xl mx-auto text-xl text-gray-600">
            Nos distinguimos por nuestro compromiso con la excelencia y la atención integral
          </p>
        </motion.div>

        <div className="grid lg:grid-cols-2 gap-16 items-center">
          {/* Galería de imágenes flexible y dinámica */}
          <motion.div
            className="relative h-96 w-full"
            initial={{ opacity: 0, x: -50 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
          >
            {/* Imagen 1 - Grande, superior izquierda */}
            <motion.div
              className="absolute top-0 left-0 w-48 h-36 z-10"
              initial={{ opacity: 0, scale: 0.8, rotate: -5 }}
              whileInView={{ opacity: 1, scale: 1, rotate: 0 }}
              transition={{ duration: 0.8, delay: 0.1 }}
              viewport={{ once: true }}
              whileHover={{ 
                scale: 1.05, 
                rotate: 2,
                zIndex: 20,
                transition: { duration: 0.3 }
              }}
            >
              <div className={`${images[0].className} bg-gradient-to-br from-blue-100 to-blue-200 w-full h-full flex items-center justify-center`}>
                <div className="text-center text-gray-500">
                  <div className="w-8 h-8 mx-auto mb-1 bg-gray-300 rounded-lg flex items-center justify-center">
                    <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 16l4.586-4.586a2 2 0 012.828 0L16 16m-2-2l1.586-1.586a2 2 0 012.828 0L20 14m-6-6h.01M6 20h12a2 2 0 002-2V6a2 2 0 00-2-2H6a2 2 0 00-2 2v12a2 2 0 002 2z" />
                    </svg>
                  </div>
                  <p className="text-xs">{images[0].alt}</p>
                </div>
              </div>
            </motion.div>

            {/* Imagen 2 - Pequeña, superior derecha */}
            <motion.div
              className="absolute top-4 right-8 w-32 h-24 z-5"
              initial={{ opacity: 0, scale: 0.6, rotate: 8 }}
              whileInView={{ opacity: 1, scale: 1, rotate: 5 }}
              transition={{ duration: 0.8, delay: 0.3 }}
              viewport={{ once: true }}
              whileHover={{ 
                scale: 1.1, 
                rotate: 8,
                zIndex: 20,
                transition: { duration: 0.3 }
              }}
            >
              <div className={`${images[1].className} bg-gradient-to-br from-pink-100 to-pink-200 w-full h-full flex items-center justify-center`}>
                <div className="text-center text-gray-500">
                  <div className="w-6 h-6 mx-auto mb-1 bg-gray-300 rounded-lg flex items-center justify-center">
                    <svg className="w-3 h-3" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 16l4.586-4.586a2 2 0 012.828 0L16 16m-2-2l1.586-1.586a2 2 0 012.828 0L20 14m-6-6h.01M6 20h12a2 2 0 002-2V6a2 2 0 00-2-2H6a2 2 0 00-2 2v12a2 2 0 002 2z" />
                    </svg>
                  </div>
                  <p className="text-xs">{images[1].alt}</p>
                </div>
              </div>
            </motion.div>

            {/* Imagen 3 - Mediana, inferior izquierda */}
            <motion.div
              className="absolute bottom-12 left-8 w-40 h-28 z-8"
              initial={{ opacity: 0, scale: 0.7, rotate: -8 }}
              whileInView={{ opacity: 1, scale: 1, rotate: -3 }}
              transition={{ duration: 0.8, delay: 0.5 }}
              viewport={{ once: true }}
              whileHover={{ 
                scale: 1.08, 
                rotate: -6,
                zIndex: 20,
                transition: { duration: 0.3 }
              }}
            >
              <div className={`${images[2].className} bg-gradient-to-br from-green-100 to-green-200 w-full h-full flex items-center justify-center`}>
                <div className="text-center text-gray-500">
                  <div className="w-7 h-7 mx-auto mb-1 bg-gray-300 rounded-lg flex items-center justify-center">
                    <svg className="w-3.5 h-3.5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 16l4.586-4.586a2 2 0 012.828 0L16 16m-2-2l1.586-1.586a2 2 0 012.828 0L20 14m-6-6h.01M6 20h12a2 2 0 002-2V6a2 2 0 00-2-2H6a2 2 0 00-2 2v12a2 2 0 002 2z" />
                    </svg>
                  </div>
                  <p className="text-xs">{images[2].alt}</p>
                </div>
              </div>
            </motion.div>

            {/* Imagen 4 - Grande, inferior derecha */}
            <motion.div
              className="absolute bottom-0 right-0 w-44 h-32 z-12"
              initial={{ opacity: 0, scale: 0.9, rotate: 3 }}
              whileInView={{ opacity: 1, scale: 1, rotate: 0 }}
              transition={{ duration: 0.8, delay: 0.7 }}
              viewport={{ once: true }}
              whileHover={{ 
                scale: 1.06, 
                rotate: -2,
                zIndex: 20,
                transition: { duration: 0.3 }
              }}
            >
              <div className={`${images[3].className} bg-gradient-to-br from-purple-100 to-purple-200 w-full h-full flex items-center justify-center`}>
                <div className="text-center text-gray-500">
                  <div className="w-8 h-8 mx-auto mb-1 bg-gray-300 rounded-lg flex items-center justify-center">
                    <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 16l4.586-4.586a2 2 0 012.828 0L16 16m-2-2l1.586-1.586a2 2 0 012.828 0L20 14m-6-6h.01M6 20h12a2 2 0 002-2V6a2 2 0 00-2-2H6a2 2 0 00-2 2v12a2 2 0 002 2z" />
                    </svg>
                  </div>
                  <p className="text-xs">{images[3].alt}</p>
                </div>
              </div>
            </motion.div>

            {/* Elementos decorativos flotantes */}
            <motion.div
              className="absolute top-20 right-20 w-3 h-3 bg-neurops-yellow rounded-full opacity-60"
              animate={{ 
                y: [0, -10, 0],
                scale: [1, 1.2, 1]
              }}
              transition={{ 
                duration: 3,
                repeat: Infinity,
                ease: "easeInOut"
              }}
            />
            <motion.div
              className="absolute bottom-20 left-20 w-2 h-2 bg-neurops-green rounded-full opacity-40"
              animate={{ 
                x: [0, 8, 0],
                opacity: [0.4, 0.8, 0.4]
              }}
              transition={{ 
                duration: 4,
                repeat: Infinity,
                ease: "easeInOut",
                delay: 1
              }}
            />
          </motion.div>

          {/* Lista de características sin iconos */}
          <motion.div
            variants={containerVariants}
            initial="hidden"
            whileInView="visible"
            viewport={{ once: true }}
            className="space-y-8"
          >
            {features.map((feature, index) => (
              <motion.div
                key={index}
                variants={itemVariants}
                className="group"
              >
                <div className="border-l-2 border-gray-200 pl-6 py-2 hover:border-neurops-black transition-colors duration-300">
                  <h3 className="text-xl font-bold text-neurops-black mb-3 group-hover:text-gray-600 transition-colors duration-300">
                    {feature.title}
                  </h3>
                  <p className="text-gray-600 leading-relaxed">
                    {feature.description}
                  </p>
                </div>
              </motion.div>
            ))}
          </motion.div>
        </div>
      </div>
    </section>
  );
};

export default About;
